import { Bar } from 'react-chartjs-2';
import React from 'react';

function BarGraph() {
  return (
    <Bar
      data={[0, 1, 2]}
      width={100}
      height={50}
      options={{
        maintainAspectRatio: false
      }}
    />
  );
}

export default BarGraph;
